CREATE DEFINER=`root`@`localhost` PROCEDURE `CreateAndNameSchoolAdmins` ()   BEGIN
    DECLARE s_id INT;
    DECLARE new_acc_id INT;
    DECLARE school_name VARCHAR(100);
    DECLARE final_username VARCHAR(50);
    
    SET s_id = 1;
    WHILE s_id <= 5 DO
        -- Lấy tên trường
        SELECT `ten_truong` INTO school_name FROM `truong_thpt` WHERE `ma_truong` = s_id;
        
        -- Xác định tên đăng nhập mong muốn dựa trên ID trường
        SET final_username = CASE 
            WHEN s_id = 1 THEN 'admin_minhkhai'
            WHEN s_id = 2 THEN 'admin_buithixuan'
            WHEN s_id = 3 THEN 'admin_giadinh'
            WHEN s_id = 4 THEN 'admin_tranphu'
            WHEN s_id = 5 THEN 'admin_macdinhchi'
            ELSE CONCAT('admin_s', s_id)
        END;

        -- 1. Tạo Tài khoản với tên xịn luôn
        INSERT INTO `tai_khoan` (`username`, `password`, `vai_tro`, `trang_thai`) 
        VALUES (final_username, '202cb962ac59075b964b07152d234b70', 'QuanTriVien', 'HoatDong');
        SET new_acc_id = LAST_INSERT_ID();
        
        -- 2. Tạo Profile người dùng
        INSERT INTO `nguoi_dung` (`ma_nguoi_dung`, `ma_tai_khoan`, `ho_ten`) 
        VALUES (new_acc_id, new_acc_id, CONCAT('Quản Trị Viên - ', school_name));
        
        -- 3. Gán quyền Admin Trường
        INSERT INTO `quan_tri_vien` (`ma_qtv`, `chuc_vu`, `ma_truong`) 
        VALUES (new_acc_id, 'Admin Trường', s_id);
        
        SET s_id = s_id + 1;
    END WHILE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateRealSchoolData` ()   BEGIN
    DECLARE s_id INT;     DECLARE g_id INT;     DECLARE c_id INT;     DECLARE cls_idx INT;  DECLARE stu_idx INT;
    DECLARE new_class_id INT;    DECLARE new_acc_id INT;    DECLARE new_hs_id INT;
    DECLARE class_name VARCHAR(50);    DECLARE full_name VARCHAR(100);    DECLARE gender VARCHAR(10);
    DECLARE subj_id INT;    DECLARE teacher_count INT;
    
    SET s_id = 1;
    WHILE s_id <= 5 DO -- 5 Trường
        
        -- A. TẠO GV BỘ MÔN
        SET subj_id = 1;
        WHILE subj_id <= 19 DO
            SET teacher_count = 1;
            WHILE teacher_count <= 3 DO
                SET full_name = CONCAT(ELT(FLOOR(1 + (RAND() * 8)), 'Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng', 'Huỳnh', 'Phan', 'Vũ'), ' ', ELT(FLOOR(1 + (RAND() * 6)), 'Văn', 'Thị', 'Minh', 'Ngọc', 'Thanh', 'Quốc'), ' ', ELT(FLOOR(1 + (RAND() * 8)), 'Hùng', 'Hương', 'Tuấn', 'Lan', 'Dũng', 'Mai', 'Sơn', 'Thảo'));
                INSERT INTO `tai_khoan` (`username`, `password`, `vai_tro`) VALUES (CONCAT('gvbm_s', s_id, '_m', subj_id, '_', teacher_count), '202cb962ac59075b964b07152d234b70', 'GiaoVien');
                SET new_acc_id = LAST_INSERT_ID();
                INSERT INTO `nguoi_dung` (`ma_nguoi_dung`, `ma_tai_khoan`, `ho_ten`) VALUES (new_acc_id, new_acc_id, full_name);
                INSERT INTO `giao_vien` (`ma_giao_vien`, `chuc_vu`) VALUES (new_acc_id, 'Giáo viên bộ môn');
                SET teacher_count = teacher_count + 1;
            END WHILE;
            SET subj_id = subj_id + 1;
        END WHILE;

        -- B. TẠO KHỐI LỚP (10, 11, 12)
        SET g_id = 10;
        WHILE g_id <= 12 DO
            SET c_id = 1;
            WHILE c_id <= 3 DO -- 3 Tổ hợp
                SET cls_idx = 1;
                WHILE cls_idx <= 3 DO -- 3 Lớp
                    SET class_name = CONCAT(g_id, CASE c_id WHEN 1 THEN 'A' WHEN 2 THEN 'B' ELSE 'D' END, cls_idx);
                    
                    -- Tạo Lớp
                    INSERT INTO `lop_hoc` (`ten_lop`, `khoi`, `si_so`, `ma_truong`, `ma_nam_hoc`) VALUES (class_name, g_id, 0, s_id, 1);
                    SET new_class_id = LAST_INSERT_ID();
                    
                    -- Tạo GVCN
                    SET full_name = CONCAT(ELT(FLOOR(1 + (RAND() * 8)), 'Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng', 'Huỳnh', 'Phan', 'Vũ'), ' ', ELT(FLOOR(1 + (RAND() * 5)), 'Thị', 'Ngọc', 'Thu', 'Phương', 'Thanh'), ' ', ELT(FLOOR(1 + (RAND() * 8)), 'Lan', 'Mai', 'Hương', 'Thảo', 'Trang', 'Huyền', 'Tâm', 'Hằng'));
                    INSERT INTO `tai_khoan` (`username`, `password`, `vai_tro`) VALUES (CONCAT('gvcn_s', s_id, '_', class_name), '202cb962ac59075b964b07152d234b70', 'GiaoVien');
                    SET new_acc_id = LAST_INSERT_ID();
                    INSERT INTO `nguoi_dung` (`ma_nguoi_dung`, `ma_tai_khoan`, `ho_ten`) VALUES (new_acc_id, new_acc_id, full_name);
                    INSERT INTO `giao_vien` (`ma_giao_vien`, `chuc_vu`) VALUES (new_acc_id, CONCAT('Chủ nhiệm lớp ', class_name));
                    
                    -- Tạo HS & PH (Chỉ Khối 11, 12)
                    IF g_id > 10 THEN
                        SET stu_idx = 1;
                        WHILE stu_idx <= 40 DO
                            IF stu_idx % 2 = 0 THEN
                                SET gender = 'Nu';
                                SET full_name = CONCAT(ELT(FLOOR(1 + (RAND() * 8)), 'Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng', 'Huỳnh', 'Phan', 'Vũ'), ' ', ELT(FLOOR(1 + (RAND() * 5)), 'Thị', 'Ngọc', 'Bảo', 'Phương', 'Thanh'), ' ', ELT(FLOOR(1 + (RAND() * 10)), 'Vy', 'Hân', 'Nhi', 'Chi', 'Linh', 'Ngân', 'Quỳnh', 'Thư', 'Trâm', 'Uyên'));
                            ELSE
                                SET gender = 'Nam';
                                SET full_name = CONCAT(ELT(FLOOR(1 + (RAND() * 8)), 'Nguyễn', 'Trần', 'Lê', 'Phạm', 'Hoàng', 'Huỳnh', 'Phan', 'Vũ'), ' ', ELT(FLOOR(1 + (RAND() * 5)), 'Văn', 'Minh', 'Quốc', 'Hoàng', 'Đức'), ' ', ELT(FLOOR(1 + (RAND() * 10)), 'Khang', 'Bảo', 'Đạt', 'Huy', 'Khoa', 'Long', 'Nam', 'Phúc', 'Quân', 'Thịnh'));
                            END IF;
                            
                            -- Tài khoản HS
                            INSERT INTO `tai_khoan` (`username`, `password`, `vai_tro`) VALUES (CONCAT('hs_s', s_id, '_', class_name, '_', LPAD(stu_idx, 2, '0')), '202cb962ac59075b964b07152d234b70', 'HocSinh');
                            SET new_acc_id = LAST_INSERT_ID();
                            INSERT INTO `nguoi_dung` (`ma_nguoi_dung`, `ma_tai_khoan`, `ho_ten`, `gioi_tinh`, `ngay_sinh`) VALUES (new_acc_id, new_acc_id, full_name, gender, '2008-01-01');
                            SET new_hs_id = new_acc_id;
                            INSERT INTO `hoc_sinh` (`ma_hoc_sinh`, `ma_lop`, `ngay_nhap_hoc`) VALUES (new_hs_id, new_class_id, '2024-09-05');
                            
                            -- Tài khoản PH
                            INSERT INTO `tai_khoan` (`username`, `password`, `vai_tro`) VALUES (CONCAT('ph_s', s_id, '_', class_name, '_', LPAD(stu_idx, 2, '0')), '202cb962ac59075b964b07152d234b70', 'PhuHuynh');
                            SET new_acc_id = LAST_INSERT_ID();
                            INSERT INTO `nguoi_dung` (`ma_nguoi_dung`, `ma_tai_khoan`, `ho_ten`) VALUES (new_acc_id, new_acc_id, CONCAT('Phụ huynh em ', full_name));
                            INSERT INTO `phu_huynh` (`ma_phu_huynh`) VALUES (new_acc_id);
                            INSERT INTO `phu_huynh_hoc_sinh` (`ma_phu_huynh`, `ma_hoc_sinh`, `quan_he`) VALUES (new_acc_id, new_hs_id, 'Phụ Huynh');
                            
                            SET stu_idx = stu_idx + 1;
                        END WHILE;
                    END IF;
                    SET cls_idx = cls_idx + 1;
                END WHILE;
                SET c_id = c_id + 1;
            END WHILE;
            SET g_id = g_id + 1;
        END WHILE;
        SET s_id = s_id + 1;
    END WHILE;
END$$

